use super::*;

/// This module contains the US Standard Atmosphere model of 1976.
/// 
/// US Standard Atmosphere 1976
/// 
/// Numerous functions retrieve atmospheric properties at a given altitude or pressure level.
pub struct USStandardAtmosphere {

}

impl USStandardAtmosphere {

    
    
    /// Returns the standard temperature based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `geopotential_altitude_feet:f64` Geopotential height in feet
    /// 
    /// # Returns:
    /// `f64` standard temperature in degrees Kelvin (°K)
    pub fn standard_temperature_deg_kelvin (geopotential_altitude_feet:f64) -> f64 {    
        let y = interp(&STANDARD_ALTITUDES_FT, &STANDARD_TEMPERATURES_KELVIN, geopotential_altitude_feet, &InterpMode::Extrapolate);
        y
    }
    
    /// Returns the standard temperature based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `geopotential_altitude_feet:f64` Geopotential height in feet
    /// 
    /// # Returns:
    /// `f64` standard temperature in degrees Celcius (°C)
    pub fn standard_temperature_deg_celcius (geopotential_altitude_feet:f64) -> f64 {    
        let kelvin = Self::standard_temperature_deg_kelvin (geopotential_altitude_feet);
        let celcius = kelvin - 273.15;
        celcius
    }
    
    /// Returns the standard temperature based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `geopotential_altitude_feet:f64` Geopotential height in feet
    /// 
    /// # Returns:
    /// `f64` standard temperature in degrees Fehrenheit (°F)
    pub fn standard_temperature_deg_fahrenheit (geopotential_altitude_feet:f64) -> f64 {    
        let celcius = Self::standard_temperature_deg_celcius (geopotential_altitude_feet);
        let feh = (celcius * (9.0/5.0)) + 32.0;
        feh
    }
    
    /// Returns the standard pressure based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `geopotential_altitude_feet:f64` Geopotential height in feet
    /// 
    /// # Returns:
    /// `f64` standard pressure in milibars (mbar)
    pub fn standard_pressure_milibars (geopotential_altitude_feet:f64) -> f64 {    
        let y = interp(&STANDARD_ALTITUDES_FT, &STANDARD_PRESSURE_MILIBAR, geopotential_altitude_feet, &InterpMode::Extrapolate);
        y
    }
    
    /// Returns the geopotential altitude from the standard pressure based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `pressure_milibars:f64` Pressure in milibars (mbar)
    /// 
    /// # Returns:
    /// `f64` standard geopotential altitude (feet)
    pub fn standard_gp_altitude_feet_from_pressure_milibars (pressure_milibars:f64) -> f64 {   
        // println!("input pressure milibars {}", pressure_milibars); 
        let y = interp(&STANDARD_PRESSURE_MILIBAR_REVERSED, &STANDARD_ALTITUDES_FT_REVERSED, pressure_milibars, &InterpMode::Extrapolate);
        // println!("output gp altitude {}", y); 
        y
    }
    
    /// Returns the pressure altitude based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `geopotential_altitude_feet:f64:f64` Geopotential height in feet
    /// `pressure_milibars:f64` Pressure in milibars (mbar)
    /// 
    /// # Returns:
    /// `f64` standard geopotential altitude (feet)
    pub fn standard_pressure_altitude (geopotential_altitude_feet:f64, sea_level_pressure_milibars:f64) -> f64 {    
        let alt_correction = Self::standard_gp_altitude_feet_from_pressure_milibars(sea_level_pressure_milibars);
        // println!("Alt correction {alt_correction}");
        let pa = geopotential_altitude_feet + alt_correction;
        pa
    }
    
    /// Returns the standard speed of sound based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `geopotential_altitude_feet:f64` Geopotential height in feet
    /// 
    /// # Returns:
    /// `f64` standard Speed of Sound in meters per second (m/s)
    pub fn standard_speed_of_sound_meters_per_second (geopotential_altitude_feet:f64) -> f64 {    
        let y = interp(&STANDARD_ALTITUDES_FT, &STANDARD_SPEED_OF_SOUND_METERS_PER_SECOND, geopotential_altitude_feet, &InterpMode::Extrapolate);
        y
    }
    
    /// Returns the standard density based on the US Standard Atmpsphere, 1976 tables.
    /// 
    /// NOTE: This function interpolates linearly in 100-foot intervals from -16,400 to +282,000 feet geopotential height. Outside of those heights, this function extrapolates.
    /// 
    /// # Arguements:
    /// `geopotential_altitude_feet:f64` Geopotential height in feet
    /// 
    /// # Returns:
    /// `f64` standard density in Kilograms per Cubic Meter (kg/m^3)
    pub fn standard_density_kilograms_per_cubic_meter (geopotential_altitude_feet:f64) -> f64 {    
        let y = interp(&STANDARD_ALTITUDES_FT, &STANDARD_DENSITY_KILOGRAMS_PER_CUBIC_METER, geopotential_altitude_feet, &InterpMode::Extrapolate);
        y
    }
}

use interp::{interp, InterpMode};

const fn reverse_array<T, const N: usize>(arr: [T; N]) -> [T; N]
where T: Copy, {
    let mut reversed = arr;
    let mut i = 0;
    while i < N / 2 {
        let temp = reversed[i];
        reversed[i] = reversed[N - 1 - i];
        reversed[N - 1 - i] = temp;
        i += 1;
    }
    reversed
}

